struct IMGUIState {
  Handle _font_texture;
  Handle _program;
  float2 _win_size;
  Handle _constant_win_size;
} g_imgui;

void on_render_draw_lists(ImDrawData* data);
void imgui_state_init();
void imgui_state_shutdown();

bool imgui_init(void* hwnd) {
  auto& IO = ImGui::GetIO();
  IO.IniFilename = nullptr;
  IO.LogFilename = nullptr;
  IO.RenderDrawListsFn = on_render_draw_lists;
  IO.ImeWindowHandle = hwnd;
  IO.KeyMap[ImGuiKey_Tab] = VK_TAB;                       // Keyboard mapping. ImGui will use those indices to peek into the io.KeyDown[] array that we will update during the application lifetime.
  IO.KeyMap[ImGuiKey_LeftArrow] = VK_LEFT;
  IO.KeyMap[ImGuiKey_RightArrow] = VK_RIGHT;
  IO.KeyMap[ImGuiKey_UpArrow] = VK_UP;
  IO.KeyMap[ImGuiKey_DownArrow] = VK_DOWN;
  IO.KeyMap[ImGuiKey_PageUp] = VK_PRIOR;
  IO.KeyMap[ImGuiKey_PageDown] = VK_NEXT;
  IO.KeyMap[ImGuiKey_Home] = VK_HOME;
  IO.KeyMap[ImGuiKey_End] = VK_END;
  IO.KeyMap[ImGuiKey_Delete] = VK_DELETE;
  IO.KeyMap[ImGuiKey_Backspace] = VK_BACK;
  IO.KeyMap[ImGuiKey_Enter] = VK_RETURN;
  IO.KeyMap[ImGuiKey_Escape] = VK_ESCAPE;
  IO.KeyMap[ImGuiKey_A] = 'A';
  IO.KeyMap[ImGuiKey_C] = 'C';
  IO.KeyMap[ImGuiKey_V] = 'V';
  IO.KeyMap[ImGuiKey_X] = 'X';
  IO.KeyMap[ImGuiKey_Y] = 'Y';
  IO.KeyMap[ImGuiKey_Z] = 'Z';

  imgui_state_init();

  return true;
}

void imgui_new_frame(const float2& win_size, const float2& mouse_pos,
                     bool mouse_down[3], float mouse_wheel, float dt) {
  auto& IO = ImGui::GetIO();
  IO.DisplaySize.x = win_size.x;
  IO.DisplaySize.y = win_size.y;
  IO.DeltaTime = dt;
  IO.MousePos.x = mouse_pos.x;
  IO.MousePos.y = win_size.y - mouse_pos.y;
  IO.MouseDown[0] = mouse_down[0];
  IO.MouseDown[1] = mouse_down[1];
  IO.MouseDown[2] = mouse_down[2];
  IO.MouseWheel = mouse_wheel;
  g_imgui._win_size = win_size;
  ImGui::NewFrame();
}

void imgui_shutdown() {

}

void on_render_draw_lists(ImDrawData* data) {
  auto GR = GraphicsRenderer::Instance();
  VertexDecl vd;
  vd.Begin()
    .Add(VERTEX_ATTR_POSITION, 2, FLOAT_TYPE, false, false)
    .Add(VERTEX_ATTR_TEXCOORD0, 2, FLOAT_TYPE, false, false)
    .Add(VERTEX_ATTR_COLOR0, 4, UINT8_TYPE, true, false)
    .End();

  u8 view = GR->PushView();
  u64 render_state = C3_STATE_RGB_WRITE | C3_STATE_ALPHA_WRITE | C3_STATE_BLEND_ALPHA;
  GR->SetViewSeq(view, true);
  GR->SetViewRect(view, 0, 0, (u16)g_imgui._win_size.x, (u16)g_imgui._win_size.y);
  GR->SetViewClear(view, C3_CLEAR_COLOR, 0x808080ff);
  GR->SetConstant(g_imgui._constant_win_size, g_imgui._win_size.ptr());
  for (int i = 0; i < data->CmdListsCount; ++i) {
    auto cmd = data->CmdLists[i];
    TransientVertexBuffer tvb;
    TransientIndexBuffer tib;
    if (GR->AllocTransientBuffers(&tvb, vd, cmd->VtxBuffer.Size,
                                  &tib, cmd->IdxBuffer.Size)) {
      memcpy(tvb.data, cmd->VtxBuffer.Data, vd.stride * cmd->VtxBuffer.Size);
      memcpy(tib.data, cmd->IdxBuffer.Data, 2 * cmd->IdxBuffer.Size);

      u32 idx_offset = 0;
      for (int j = 0; j < cmd->CmdBuffer.Size; ++j) {
        auto& batch = cmd->CmdBuffer[j];
        GR->SetScissor(u16(batch.ClipRect.x), u16(g_imgui._win_size.y - batch.ClipRect.w),
                       u16(batch.ClipRect.z - batch.ClipRect.x),
                       u16(batch.ClipRect.w - batch.ClipRect.y));
        //c3_log("imgui texture handle: %d, %p\n", Handle((u32)uintptr_t(batch.TextureId)).idx, batch.TextureId);
        GR->SetTexture(0, Handle((u32)uintptr_t(batch.TextureId)));
        GR->SetVertexBuffer(&tvb);
        GR->SetIndexBuffer(&tib, idx_offset, batch.ElemCount);
        GR->SetState(render_state);
        GR->Submit(view, g_imgui._program);
        idx_offset += batch.ElemCount;
      }
    }
  }
  GR->PopView();
}

void imgui_state_init() {
  auto& IO = ImGui::GetIO();
  auto GR = GraphicsRenderer::Instance();
  unsigned char* pixel = nullptr;
  int width = 0;
  int height = 0;
  ImFontConfig font_config;
  IO.Fonts->AddFontFromFileTTF("Fonts/simhei.ttf", 18, &font_config, IO.Fonts->GetGlyphRangesChinese());
  IO.Fonts->GetTexDataAsAlpha8(&pixel, &width, &height);
  g_imgui._font_texture = GR->CreateTexture2D((u16)width, (u16)height, 1, RED_8_TEXTURE_FORMAT,
                                              C3_TEXTURE_MIN_POINT | C3_TEXTURE_MAG_POINT, mem_ref(pixel, width * height));
  IO.Fonts->TexID = (void*)g_imgui._font_texture.ToRaw();
  //c3_log("create imgui texture handle: %hd, %p\n", g_imgui._font_texture.idx, IO.Fonts->TexID);
  auto vsh = GR->CreateShader(mem_ref(quad_vsh_data, sizeof(quad_vsh_data)));
  auto fsh = GR->CreateShader(mem_ref(quad_fsh_data, sizeof(quad_fsh_data)));
  g_imgui._program = GR->CreateProgram(vsh, fsh, true);
  g_imgui._constant_win_size = GR->CreateConstant(hash_string("win_size"), CONSTANT_VEC2, 1);
}

